  "translationLines": [
    {
      "lineNumber": 26091,
      "originalJapaneseLine": "「お祭り？　太鼓でせいやー、って？」",
      "translatedEnglishLine": "\"A festival? Like, beating the drums and shouting 'Seiya' or something?\""
    },
    {
      "lineNumber": 26092,
      "originalJapaneseLine": "「ちこっと違うけどな。ランスが好きな奴や」",
      "translatedEnglishLine": "\"It's a little different. It's something that people who like Rance enjoy.\""
    },
    {
      "lineNumber": 26093,
      "originalJapaneseLine": "「えっ…………？」",
      "translatedEnglishLine": "\"Eh... ?\""
    },
    {
      "lineNumber": 26094,
      "originalJapaneseLine": "「ほう、つまりエロいやつか！",
      "translatedEnglishLine": "\"Oh, so it means it's an erotic thing!\""
    },
    {
      "lineNumber": 26095,
      "originalJapaneseLine": "　俄然やる気が出てきたぞ！」",
      "translatedEnglishLine": "\"I'm suddenly getting fired up!\""
    },
    {
      "lineNumber": 26096,
      "originalJapaneseLine": "「え、ほ、ホントにそんなのあるの……？",
      "translatedEnglishLine": "\"Eh, re-really, does something like that actually exist...?\""
    },
    {
      "lineNumber": 26097,
      "originalJapaneseLine": "　ランスを焚きつける嘘とかじゃなくて？」",
      "translatedEnglishLine": "\"You're not just lying to rile Rance up, right?\""
    },
    {
      "lineNumber": 26098,
      "originalJapaneseLine": "「ふふ、さーて。着いてからのお楽しみや」",
      "translatedEnglishLine": "\"Hehe, well then. It'll be a surprise after we arrive.\""
    },
    {
      "lineNumber": 26099,
      "originalJapaneseLine": "「がはははーっ。地底王国のエロ祭りか！",
      "translatedEnglishLine": "\"Gahahaha! An erotic festival in the underground kingdom!\""
    },
    {
      "lineNumber": 26100,
      "originalJapaneseLine": "　よし、突撃だ！」",
      "translatedEnglishLine": "\"Alright, charge!\""
    },
    {
      "lineNumber": 26101,
      "originalJapaneseLine": "「…………ずいぶん来ましたね」",
      "translatedEnglishLine": "\"...We have come quite far, haven't we?\""
    },
    {
      "lineNumber": 26102,
      "originalJapaneseLine": "「そうだな。まだか？　コパンドン」",
      "translatedEnglishLine": "\"That's right. Are we there yet? Kopandon.\""
    },
    {
      "lineNumber": 26103,
      "originalJapaneseLine": "「ん。そろそろやで。",
      "translatedEnglishLine": "\"Mm. It's about time.\""
    },
    {
      "lineNumber": 26104,
      "originalJapaneseLine": "　そこ曲がったら、アレルギー超大国の扉が……」",
      "translatedEnglishLine": "\"If you turn there, you'll see the door to the Allergy Superpower...\""
    },
    {
      "lineNumber": 26105,
      "originalJapaneseLine": "「…………あれ？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 26106,
      "originalJapaneseLine": "曲がった先には、通路いっぱいを塞ぐ扉。",
      "translatedEnglishLine": "At the bend ahead, there is a door blocking the entire passage."
    },
    {
      "lineNumber": 26107,
      "originalJapaneseLine": "そこには、巨大な機械が通せんぼしていた。",
      "translatedEnglishLine": "A huge machine was blocking the way there."
    },
    {
      "lineNumber": 26108,
      "originalJapaneseLine": "「……なんだ？　あの邪魔っけなデカブツは」",
      "translatedEnglishLine": "\"...What is that annoying huge thing?\""
    },
    {
      "lineNumber": 26109,
      "originalJapaneseLine": "「ポピンズの器兵や。",
      "translatedEnglishLine": "\"It's a Poppins' mechanical soldier.\""
    },
    {
      "lineNumber": 26110,
      "originalJapaneseLine": "　自律型……つまり、勝手に動きよんねん」",
      "translatedEnglishLine": "\"An autonomous type... in other words, it moves on its own.\""
    },
    {
      "lineNumber": 26111,
      "originalJapaneseLine": "「…………せやけど、初めて見るタイプやな……",
      "translatedEnglishLine": "\"...But it's a type I've never seen before...\""
    },
    {
      "lineNumber": 26112,
      "originalJapaneseLine": "　それにいつもは、一緒に門番さんが……」",
      "translatedEnglishLine": "\"Also, usually the gatekeeper is with it...\""
    },
    {
      "lineNumber": 26113,
      "originalJapaneseLine": "「う、動き出したわよ！？",
      "translatedEnglishLine": "\"Ugh, it's started moving!?\""
    },
    {
      "lineNumber": 26114,
      "originalJapaneseLine": "　なんか、やる気満々って感じなんだけど……」",
      "translatedEnglishLine": "\"It kind of feels totally fired up...\""
    },
    {
      "lineNumber": 26115,
      "originalJapaneseLine": "「し、しかし、これはアレルギー超大国の……」",
      "translatedEnglishLine": "\"B-but this is the Allergy Superpower's...\""
    },
    {
      "lineNumber": 26116,
      "originalJapaneseLine": "「向こうが襲いかかってくるんだ、",
      "translatedEnglishLine": "\"They're attacking us;\""
    },
    {
      "lineNumber": 26117,
      "originalJapaneseLine": "　そんな悠長な事言ってられるか！」",
      "translatedEnglishLine": "\"We can't afford to be so leisurely!\""
    },
    {
      "lineNumber": 26118,
      "originalJapaneseLine": "「ちっ、こいつ、なかなかやるな……」",
      "translatedEnglishLine": "\"Tch, this guy's tougher than I thought...\""
    },
    {
      "lineNumber": 26119,
      "originalJapaneseLine": "「お、大きいのに動きが速いです……！",
      "translatedEnglishLine": "\"I-it's big but moves quickly...!\""
    },
    {
      "lineNumber": 26120,
      "originalJapaneseLine": "　回り込んでも感づかれちゃいますし……」",
      "translatedEnglishLine": "\"Even if we try to flank it, it senses us...\""
    },
    {
      "lineNumber": 26121,
      "originalJapaneseLine": "「ぬう……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 26122,
      "originalJapaneseLine": "「はーーー……すっごい……芸術だわ……",
      "translatedEnglishLine": "\"Haaah... It's incredible... art...\""
    },
    {
      "lineNumber": 26123,
      "originalJapaneseLine": "　歯車とゼンマイだけで、これだけの自立行動……",
      "translatedEnglishLine": "\"Autonomous behavior like this with only gears and springs...\""
    },
    {
      "lineNumber": 26124,
      "originalJapaneseLine": "　匠の技ね……」",
      "translatedEnglishLine": "\"It's the craftsmanship of a master...\""
    },
    {
      "lineNumber": 26125,
      "originalJapaneseLine": "「言ってる場合か！",
      "translatedEnglishLine": "\"Is this the time for talking!\""
    },
    {
      "lineNumber": 26126,
      "originalJapaneseLine": "　このポンコツ、さっさと叩き壊すぞ！」",
      "translatedEnglishLine": "\"Let's smash this junk quickly!\""
    },
    {
      "lineNumber": 26127,
      "originalJapaneseLine": "「あーん、もったいなーい！」",
      "translatedEnglishLine": "\"Aah, what a waste!\""
    },
    {
      "lineNumber": 26128,
      "originalJapaneseLine": "「ちっ、くそしぶとい……ん？」",
      "translatedEnglishLine": "\"Tch, damn stubborn... huh?\""
    },
    {
      "lineNumber": 26129,
      "originalJapaneseLine": "「総統……器兵の動き……",
      "translatedEnglishLine": "\"Commander... the mechanical soldier's movements...\""
    },
    {
      "lineNumber": 26130,
      "originalJapaneseLine": "　なんだか妙ではないですか？」",
      "translatedEnglishLine": "\"Don't they seem strange somehow?\""
    },
    {
      "lineNumber": 26131,
      "originalJapaneseLine": "「……確かに……なんだか、カクカクと……罠か？」",
      "translatedEnglishLine": "\"...Indeed... They're kind of jerky... Is it a trap?\""
    },
    {
      "lineNumber": 26132,
      "originalJapaneseLine": "「あー……ダメージ受けすぎなのかも。",
      "translatedEnglishLine": "\"Ah... maybe it's taken too much damage.\""
    },
    {
      "lineNumber": 26133,
      "originalJapaneseLine": "　不具合起こしてるみたい」",
      "translatedEnglishLine": "\"It seems to be malfunctioning.\""
    },
    {
      "lineNumber": 26134,
      "originalJapaneseLine": "「不具合……動きが鈍っているという事ですか？」",
      "translatedEnglishLine": "\"A malfunction... meaning its movements are sluggish?\""
    },
    {
      "lineNumber": 26135,
      "originalJapaneseLine": "「うん。複雑な機構になってるせいもあって、",
      "translatedEnglishLine": "\"Yeah. Because of its complex mechanisms,\""
    },
    {
      "lineNumber": 26136,
      "originalJapaneseLine": "　衝撃でおかしくなってるんだと思う」",
      "translatedEnglishLine": "\"I think the shock has messed it up.\""
    },
    {
      "lineNumber": 26137,
      "originalJapaneseLine": "「あああ、もったいないなぁ……",
      "translatedEnglishLine": "\"Aah, what a waste...\""
    },
    {
      "lineNumber": 26138,
      "originalJapaneseLine": "　ちょっと待っててね、今直して……」",
      "translatedEnglishLine": "\"Wait a moment, I'll fix it right now...\""
    },
    {
      "lineNumber": 26139,
      "originalJapaneseLine": "「このアホ！　正気に返れ！」",
      "translatedEnglishLine": "\"You idiot! Snap out of it!\""
    },
    {
      "lineNumber": 26140,
      "originalJapaneseLine": "「きゃううっ！？",
      "translatedEnglishLine": "\"Kyaau!?\""
    },
    {
      "lineNumber": 26141,
      "originalJapaneseLine": "「がはははは！　よーし、チャーンス！",
      "translatedEnglishLine": "\"Gahahahaha! Alright, chance!\""
    },
    {
      "lineNumber": 26142,
      "originalJapaneseLine": "　ぶっ殺す！」",
      "translatedEnglishLine": "\"I'm going to kill it!\""
    },
    {
      "lineNumber": 26143,
      "originalJapaneseLine": "「ふん、思い知ったか、ガラクタめ」",
      "translatedEnglishLine": "\"Hmph, did you learn your lesson, you piece of junk?\""
    },
    {
      "lineNumber": 26144,
      "originalJapaneseLine": "「ああぁあ…………もったいない……",
      "translatedEnglishLine": "\"Aaaaah... such a waste...\""
    },
    {
      "lineNumber": 26145,
      "originalJapaneseLine": "　すごい動きだったのに……」",
      "translatedEnglishLine": "\"Even though it had amazing movements...\""
    },
    {
      "lineNumber": 26146,
      "originalJapaneseLine": "（国際問題に発展しないといいけど）",
      "translatedEnglishLine": "(I hope this doesn't escalate into an international incident.)"
    },
    {
      "lineNumber": 26147,
      "originalJapaneseLine": "「よし、開けろシィル。小人の里に乱入だ」",
      "translatedEnglishLine": "\"Alright, open it, Seel. We're storming the village of the little people.\""
    },
    {
      "lineNumber": 26148,
      "originalJapaneseLine": "「あ、は、はいっ。",
      "translatedEnglishLine": "\"Y-yes.\""
    },
    {
      "lineNumber": 26149,
      "originalJapaneseLine": "　ん、しょっ……えい、やっ……」",
      "translatedEnglishLine": "\"Hm, heave... ei, ya...\""
    },
    {
      "lineNumber": 26150,
      "originalJapaneseLine": "シィルは鉄の大扉に手を掛けるが、",
      "translatedEnglishLine": "Seel placed her hand on the large iron door, but"
    }
  ]
}

